import React, { Component } from 'react';
import './home.css';

import styled from 'styled-components';

import { Button, ButtonLink } from '../../reusable/button';
import GalleryButton from '../../reusable/gallery-button';

const Container = styled.div`
    display: flex;
`

class Home extends Component {

    fetchGalleries() {

    }

    handleClick() {
        console.log('Test');
    }

    componentDidMount() {

    }

    render() {
        return (
            <>
                <Container>
                    <Button onClick={() => console.log('clicked')} name="Button" />
                    <GalleryButton to="test" imageSrc="https://via.placeholder.com/450" imageAlt="placeholder" galleryName="Architecture"/>
                </Container>
            </>
        )
    }
}

export default Home;
